import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='body'>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
        <li>4</li>
        <li>5</li>
      </ul> 
    </div>
  );
}

export default App;
